import http from "./http-common";

class AccountingProviderService {
  getAll() {
    return http.get("/account-provider");
  }
  getBalanceSheet(companyTaxId) {
    return http.get(`/account-provider/balance-sheet/${companyTaxId}`);
  }
}

export default new AccountingProviderService();
